import { useState } from "react";
import { addActivity } from "../../Redux/actions";

const form = () => {
    const [activity, setActivity] = useState({
        name: "",
        difficult: "",
        duration: "",
        season: "",
        Country: "",
    });

    const handleChange = (event) => {
        setActivity(event.target.value);
    }
}

export default form;
